Hay una frase que mi hermana siempre repite, que me encanta: no somos lo que nos dijeron. 
Porque es verdad, no somos la súper mujer, no somos el súper yo, no podemos conseguir todo lo que nos propongamos por mucho que nos lo propongamos, no somos tan importantes, somos insignificantes. 
Y qué bien, 
y cuanta alegría trae estas verdades a mi corazón. Porque sé yo no tengo por qué ser fuerte, si tengo la fuerza de Dios. 
Mi fortaleza está en el conocimiento de que Dios está conmigo. Mi resistencia está en el saber que Dios se deleita en mi fragilidad. 
Y en estos momentos, en el que la tierra está manifestando nuestra insignificancia y nuestra incapacidad de controlar nada, me aferro a las promesas, me aferro a Sus promesas. 
No olvidemos este poderoso versículo: "Por lo cual estoy seguro de que ni la muerte, ni la vida, ni ángeles, ni principados, ni potestades, ni lo presente, ni lo por venir, ni lo alto, ni lo profundo, ni ninguna otra cosa creada nos podrá separar del amor de Dios" 

Confiemos. Abracemos la promesa del Dios soberano.

